var listOfMarkers = [];

function initMapCustom() {
    if($('.editorial-store-locator-multiple-wrapper').length){
        $('.editorial-store-locator-multiple-wrapper').each(function() {
            var mapContainer = $(this).find('.map-container');
            var textContainer = $(this).find('.text-box');
            mapContainer.attr('style','height:'+$(textContainer).height()+'px;');
            var buttonLabel = $(this).find('.buttonLabel3Cols').val();
            initMapMultipleMarker($(this), buttonLabel);
        });
    }
    if($('.editorial-store-locator-single-wrapper').length){
        $('.editorial-store-locator-single-wrapper').each(function() {
            var mapContainer = $(this).find('.map-container');
            var textContainer = $(this).find('.text-box');
            mapContainer.attr('style','height:'+$(textContainer).height()+'px;');
            initMapSingleMarker($(this));
        });
    }
}

/*
 * Called by editorial-store-locator
 */
function initMapMultipleMarker(mapComponent, buttonLabel) {
	var geocoder = new google.maps.Geocoder;
	var firstCountry = retrieveDefaultCountry(mapComponent);
	//var countryAndStores = $(mapComponent).find('.countryAndStores');
	var stores = getStores(firstCountry)
	createGeoCoder(stores, geocoder, mapComponent, buttonLabel);
}

function initMapSingleMarker(mapComponent) {
	var geocoder = new google.maps.Geocoder;
	var address = $(mapComponent).find('.address').data('address');
	var mapLabel = $(mapComponent).find('.address').data('map-button');
	var store = {
		"address": address,
		"type": 'info',
		"label": address,
		"mapLabel" : mapLabel
	}
	createGeoCoderSingleMarker(store, geocoder, mapComponent);
}

function getStores(countryAndStores) {
    var stores = [];
    var country = $(countryAndStores).find('.countrylabel');
    var address = $(countryAndStores).find('.storeaddress');
    address.each(function () {
        stores.push({
            "address": $(this).data('address'),
            "type": 'info',
            "label": $(this).text(),
            "country" : country.text(),
            "mapLabel" : $(this).data('map-button')
        });
    });
    return stores;
}

function getIcon() {
	var iconBase = 'https://www.illy.com/professional/images/company/gmap/';
	var icons = {
		info: {
			icon: iconBase + 'ico-map-locale.png'
		}
	};
	return icons;
}


function retrieveDefaultCountry(mapComponent) {
	var countryAndStores = $(mapComponent).find('.countryAndStores')[0];
	return countryAndStores;
}

function createMap(mapContent) {
	var map = new google.maps.Map(mapContent[0].getElementsByClassName('map-container')[0], {
		zoom: 6
	});
	return map;
}

function createInfoWindow(contentString) {
	return new google.maps.InfoWindow({
		content: contentString,
	});
}

/*
 * Create and return a new marker for each store
 */
function createMarker(infowindow, icons, store, results, map) {
	var marker = new google.maps.Marker({
			position: results[0].geometry.location,
			icon: icons[store.type].icon,
			map: map
	});
	
	marker.addListener('click', function () {
		map.setCenter(results[0].geometry.location);
		map.setZoom(17);
		infowindow.open(map, marker);
	});

	//$("span.address.storeaddress").css("cursor", "default");
	var address = getDataAddress(infowindow.content);
	if(address) {
		/*
		if($("[data-address='" + address + "']") && $("[data-address='" + address + "']").parent()) {
			$("[data-address='" + address + "']").parent().children().css("cursor", "pointer");
		}
		*/
		$("[data-address='" + address + "']").click(function () {
			map.setCenter(results[0].geometry.location);
			map.setZoom(17);
			infowindow.open(map, marker);
		});
	}
	
	return marker;
}

/*
 * Called by createMarker
 * Used to obtain address from html
 */
function getDataAddress(html) {
    
	var address = "";
	if(html) {
		var div = document.createElement("div");
		div.innerHTML = html;
		if(div.getElementsByTagName("p").length > 0) {
			address = div.getElementsByTagName("p")[0].innerText;
		} else if($(div).find("h2.firstHeading")) {
			address = $(div).find("h2.firstHeading").text();
		}
	}
	return address;
}

/*
 * Called by initMapSingleMarker and event click
 * Used by editorial store locator single marker
 */
function createGeoCoderSingleMarker(store, geocoder, mapComponent) {
	var map = createMap(mapComponent);
	geocoder.geocode({'address': store.address}, function (results, status) {
		if (status === 'OK') {
            var lat = results[0].geometry.location.lat();
            var lng = results[0].geometry.location.lng();
            var buttonContent = store.mapLabel != undefined ? '<a href="https://www.google.com/maps/search/?api=1&query=' + lat + ',' + lng +'" target="_blank"><span class="illy-button red-btn">' + store.mapLabel +'</span></a>' : '';
            var currentContentString = '<div id="content">'
                + '<div id="siteNotice">'
                + '</div>'
                + '<div class="bodyContent">'
                + '<h2 id="firstHeading" class="firstHeading ">'
                + store.label
                + '</h2>'
                + buttonContent
                + '</div>' + '</div>';
          	var infowindow = createInfoWindow(currentContentString);
			var marker;
			marker = createMarker(infowindow, icons, store, results, map);
			var latLng = marker.getPosition(); // returns LatLng object
			map.setCenter(latLng); // setCenter takes a LatLng object
		} else {
			console.error('Geocode was not successful for the following reason: ' + status);
		}
	});
    var icons = getIcon();
}

/*
 * Called by initMap and event click
 * Used by editorial store locator
 */
function createGeoCoder(stores, geocoder, mapComponent, buttonLabel) {
	var latlngbounds = new google.maps.LatLngBounds();
	var map = createMap(mapComponent);
	createMapWithGeoCoder(stores,geocoder,mapComponent,latlngbounds,map, buttonLabel);
}

function createMapWithGeoCoder(stores,geocoder,mapComponent,latlngbounds,map, buttonLabel) {
    var errorStore = [];
    var geoCodeCont = 0;
	stores.forEach(function (store) {
        geocoder.geocode({'address': store.address}, function (results, status) {
			geoCodeCont++;
            if (status === 'OK') {
                errorStore = jQuery.grep(errorStore, function(value) {
                    return value != store;
                });
                var lat = results[0].geometry.location.lat();
                var lng = results[0].geometry.location.lng();
                var buttonContent = buttonLabel ? '<a href="https://www.google.com/maps/search/?api=1&query=' + lat + ',' + lng +'" target="_blank"><span class="illy-button red-btn butt-call-to-action">' + buttonLabel +'</span></a>' : '';
                var currentContentString = '<div id="content">'
                + '<div id="siteNotice">'
                + '</div>'
                + '<div class="bodyContent">'
                + '<h2 id="firstHeading" class="firstHeading ">'
                + store.label
                + '</h2>'
                + '<p style="margin-bottom: 15px;">'
                + store.address
                + '</p>'
                + buttonContent
                + '</div>' + '</div>';
                var infowindow = createInfoWindow(currentContentString);
                var marker;
                marker = createMarker(infowindow, icons, store, results, map);
                latlngbounds.extend(marker.position);
                //Center map and adjust Zoom based on the position of all markers.
                map.setCenter(latlngbounds.getCenter());
                map.fitBounds(latlngbounds);
            } else if(status === 'OVER_QUERY_LIMIT') {
                errorStore.push(store);
            }else {
                console.error('Geocode was not successful for the following reason: ' + status);
            }
            if(geoCodeCont == stores.length){
				geoCodeCont = 0;
                setTimeout(function() {
                    createMapWithGeoCoder(errorStore, geocoder, mapComponent,latlngbounds,map);
                }, 200);
            }
        });
	});
    var icons = getIcon();
}

