$(document).ready(function () {

	if($(".disclaimerPopup-wrapper").length) {
		var isAdult = getCookieByName("isAdult");
		if(!isAdult || isAdult != "true") {
			document.querySelector(".disclaimerPopup-wrapper").style = "";
		}
		
		document.querySelector("#age-gate-agree").addEventListener("click", function() {
			document.querySelector(".disclaimerPopup-wrapper").style.display = "none";
			document.cookie = "isAdult=true;";
		})
	}
	
	function getCookieByName(searchedName) {
		
		var allCookies = document.cookie;
		var searchedCookie = undefined;
		var cookieName = "";
		
		if(allCookies.includes(searchedName)) {
			var cookies = allCookies.split(";");
			for(let i = 0; i < cookies.length; i++) {
				cookieName = cookies[i].includes("=") ? cookies[i].split("=")[0].trim() : "";
				if(cookieName && cookieName == searchedName) {
					searchedCookie = cookies[i].split("=")[1].trim();
					break;
				}
			}
		}
		
		return searchedCookie;		
	}
});
